 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>\u4e0b\u62c9\u7ec3\u4e60\u662f\u6587\u672c\u6216\u53e5\u5b50\uff0c\u5b66\u751f\u5fc5\u987b\u5728\u5176\u4e2d\u9009\u62e9\u6b63\u786e\u7684\u5355\u8bcd\u3002\u5b83\u4eec\u901a\u5e38\u7528\u4e8e\u4ee5\u4e0b\u76ee\u7684\uff1a <\/p><ol><li>\u68c0\u67e5\u6838\u5fc3\u8bfe\u7a0b\u6982\u5ff5\u7684\u77e5\u8bc6\uff08\u53ef\u4ee5\u662f\u9884\u68c0\u67e5\uff0c\u5f62\u6210\u6027\u7ec3\u4e60\u6216\u603b\u7ed3\u6027\u68c0\u67e5\uff09\u3002 <\/li><li>\u68c0\u67e5\u9605\u8bfb\u7406\u89e3\u529b\u3002 <\/li><li>\u68c0\u67e5\u8bcd\u6c47\u77e5\u8bc6\u3002 <\/li><li>\u68c0\u67e5\u5355\u8bcd\u6784\u6210\u548c\/\u6216\u8bed\u6cd5\u80fd\u529b\u3002 <\/li><\/ol>", 
